import React from 'react'
import './login.css'
const Login = ({ openModal }) => {
    console.log(openModal);

    return (
        <div className={openModal ? 'login' : 'login d-none'}>
            <div className="row">
                <div className="col-md-2 login-left">
                    <img src="https://icatcare.org/app/uploads/2018/06/Layer-1704-1200x630.jpg" alt="" />
                </div>
                <div className="col-md-2"></div>
            </div>
        </div>
    )
}

export default Login
